import {rahul} from 'assets/img/image/teams/team19/Rahul Aggarwal.webp';

const teamStyle = {
  root: {
    flexGrow: 1,
  },
  box: {
    marginLeft: '6vw',
    marginTop: '10vh',  
    boxShadow: '0px 5px 7px 7px #888888',
    height: '30vh',
  },
  rahul: {
    position: 'absolute',
    height: '40vh',
    filter: 'blur(10px)',
    clipPath: 'polygon(0 0, 100% 0%, 100% 43%, 0 64%)'
  },
  imag: {
      margin: 'auto',
      height: '18vh',
      width: '9vw',
  },
}

export default teamStyle;
